import './Public.css'

function Pablic () {

  return (
  <section className='header__resources'>
    <div className='block-text'>
      <h1 className='block-text_title'>Учебный проект студента факультета Веб&#8209;разработки.</h1>
    </div>
    <ul className='block-navigation'>
      <li><button className='block-navigation__button'><a className='block-navigation__info' href='#about'>О проекте</a></button></li>
      <li><button className='block-navigation__button'><a className='block-navigation__info' href='#technologies'>Технологии</a></button></li>
      <li className='block-navigation__info block-navigation__info_student'><button className='block-navigation__button'><a className='block-navigation__info' href='#student'>Студент</a></button></li>
    </ul>
  </section>
  );
}

export default Pablic;
